import React, {Fragment} from "react";
import AvailableMeal from "./AvailableMeal";
import MealSummary from "./MealSummary"


const Meals = () => {
    return (
        <Fragment>
            <AvailableMeal />
            <MealSummary />
        </Fragment>
    )
}

export default Meals;
